import React from 'react';
import cl from './Posts.module.css';
import Post from './Post/Post';

const Posts = () => {
    return (
        <div>
            My posts
            <div>
                New post
            </div>
            <div className={cl.posts}>
                <Post />
            </div>
        </div>
    );
}

export default Posts;
